import React from 'react';
import {Bar, BarChart} from "recharts";


export type tinyBarChartProps = {
  tinyBarChartData:any
  graphData?:any
}

const TinyBarChart =(props:tinyBarChartProps)=>{
    return (
      <BarChart width={350} height={150} data={props?.tinyBarChartData}>
        <Bar dataKey="uv" fill="#8884d8" />
      </BarChart>
    );
  }
  export default TinyBarChart;
